    // R2 = (exists(i:int[0,2]) cLane[i] == lane2.ID) && (exists(i:int[0,2]) cLane[i] == lane1.ID || cLane[i] == lane3.ID); // C2 starts to work
    R2 = (exists(i:int[0,2]) cLane[i] == lane2.ID) && (exists(i:int[0,2]) cLane[i] == lane1.ID);

    return !offroad(cps_shape, cps_state) && R2;
}

// keep in lane1 or lane3
bool C3(){
    bool R3;
    int32_t cLane[3] = {-1, -1, -1};

    detect_lane(cps_state, cps_shape, cLane);
    R3 = (cLane[0] == lane1.ID || cLane[0] == lane3.ID) && cLane[1] == -1 && cLane[2] == -1; // C3 starts to work

    return !offroad(cps_shape, cps_state) && R3;
}

